	Common.AutoCodeCache acc WITH (ROWLOCK, UPDLOCK, INDEX(IX_AutoCodeCache_Entity_Property_Grouping_Prefix))
WHERE
	acc.Entity = @entity
	AND acc.Property = @property
	AND acc.Grouping = @grouping
