	INSERT INTO
		Common.AutoCodeCache WITH (ROWLOCK, UPDLOCK)
		(ID, Entity, Property, Grouping, Prefix, MinDigits, LastCode)
	VALUES
		(NEWID(), @entity, @property, @grouping, @prefix, @minDigits, @providedCode);
END

